                items[""Estatus""] = $(""#est5"").val();
                items[""IdActaDetalle""] = $(""#idres5"").val();

                $.ajax({
                    url: '/admin/TActas/CreateRP',
                    type: 'POST',
                    data: {
                        item: items
                    },
                    success: function (data) {
                        if (data.success) {

                            toastr.success(data.mensaje, {
                                closeButton: true,
                                progressBar: true,
                                showMethod: 'slideDown',
                                timeOut: 2000
                            });
                            window.setTimeout(Refresco, 2000);

                        }
                        else {
        ");
